description:
Miami Medical - Brand New Series - Pilot Episode

Episode 1.

A team of surgeons work trauma cases in a Miami hospital. In the opener, a gas explosion at an ice-cream shop seriously injures a pregnant woman and her husband. At the hospital, the chief surgeon (Andre Braugher) suddenly quits, leaving his staff in shock. Stepping in is a mysterious physician (Jeremy Northam) newly arrived from Baltimore who once worked as a military surgeon.
